import React from "react";

const footerStyle = {
  backgroundColor: "#f4f4f4",
  padding: "20px 0",
  color: "#333",
};

const innerContainer = {
  display: "flex",
  justifyContent: "space-between",
  alignItems: "flex-start",
  maxWidth: "1200px",
  margin: "0 auto",
  padding: "0 20px",
};

const linkList = {
  listStyle: "none",
  padding: 0,
};

const copyrightContainer = {
  textAlign: "center",
  marginTop: "20px",
};

function Footer() {
  return (
    <footer style={footerStyle}>
      <div style={innerContainer}>
        <div>
        <div>Our Presence</div>
<ul>
  <li>
    
  </li>
</ul>
        </div>
        <div>
          <h3>Contact Information</h3>
          <p>Address: [Your Firm's Address]</p>
          <p>Phone: [Your Firm's Phone Number]</p>
          <p>Email: [Your Firm's Email]</p>
        </div>
        <div>
          <h3>Useful Links</h3>
          <ul style={linkList}>
            <li>
              <a href="#">Home</a>
            </li>
            <li>
              <a href="#">Services</a>
            </li>
            <li>
              <a href="#">About Us</a>
            </li>
            <li>
              <a href="#">Contact Us</a>
            </li>
            {/* Add more links based on your website */}
          </ul>
        </div>
      </div>
      <div style={copyrightContainer}>
        <p>
          &copy; {new Date().getFullYear()} Your CA Firm. All rights reserved.
        </p>
      </div>
    </footer>
  );
}

// Styles

export default Footer;
